import React from 'react';

const Widget = (props) => {

    const windInfo = props.windDirection + ' ' + props.windSpeed;
    return (
        <table className="ui two very basic column table">
            <tbody>
                <tr>
                    <td>
                        <h5>{props.title}</h5>
                    </td>
                </tr>
                <tr>
                    <td>
                        <img
                            src={props.imgURL}
                            alt={props.imgDecription}
                        />
                    </td>
                    <td>
                        {props.city}
                        <h1>{props.temperature}</h1>
                        {
                            props.showWind &&
                            <div><b>Wind  </b>{windInfo}</div>
                        }
                    </td>
                </tr>
            </tbody>
        </table>
    );
};

export default Widget;
